import React from 'react';
import '../hoja-de-estilos/Card.css';

function Card({
  temp,
  max,
  min,
  name,
  img,
  onClose,
  handleOnDragEnd,
  humidity,
  lon,
  lat,
}) {
  // ac치 va tu c칩digo
  return (
    <div className="flip-card">
      <div className="flip-card-inner">
        <div className="flip-card-front">
          <img
            src={`http://openweathermap.org/img/wn/${img}@2x.png`}
            width={'5px'}
            alt={'image_weather'}
          />
          <h3>{name}</h3>
          <h2>{`Min: ${min}`}</h2>
          <h2>{`Max: ${max}`}</h2>
        </div>
        <div className="flip-card-back">
          <button onClick={onClose} className="button_close">
            X
          </button>
          <img
            src={`http://openweathermap.org/img/wn/${img}@2x.png`}
            width={'5px'}
            alt={'image_weather'}
          />
          <h3>{name}</h3>
          <h2>{`Min: ${min}`}</h2>
          <h2>{`Max: ${max}`}</h2>
          <button className="button_details">Details</button>
        </div>
      </div>
    </div>
  );
}

export default Card;
